# Função para normalizar rótulos (0/1)
def normalize_label(x):
    s = str(x).strip().lower()
    if s in {"1", "sim", "s", "true", "verdadeiro", "y"}:
        return 1
    if s in {"0", "não", "nao", "n", "false", "falso", "-"}:
        return 0
    try:
        v = float(s)
        if v == 1: return 1
        if v == 0: return 0
    except:
        pass
    return None

